write a Python program to print out the first 100 prime numbers
Here is one possible solution in Python:

import math

def is_prime(n):
    if n < 2: return False
    for i in range(2, int(math.sqrt(n))+1):
        if (n % i == 0):
            return False
    return True

primes = []
for i in range(3, 100):
    if is_prime(i):
        primes.append(i)

print(primes[:100])
